import request from '@/utils/request'

const base = `/supplier`

export default {
    add(supplier) {
        return request({
            url: `${base}/add`,
            method: 'post',
            data: supplier
        })
    },
    page(current, size) {
        return request({
            url: `${base}/${current}/${size}`,
            method: 'get',
        })
    }
}
